import ExploreScreen from "./ExploreScreen/ExploreScreen";

const Tuiter = () => {
    return(
        <>
            <h1 id="hello">Hello World</h1>
            $("#hello").html("Hello World!")
            <ExploreScreen/>

        </>
    )
};
export default Tuiter;
